import React from 'react';
import $ from 'jquery';

import SiteNavbar from './SiteNavbar';
import TeamMember from './TeamMember';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import TeamLead1 from '../img/teamLead1.jpg';
import TeamLead2 from '../img/teamLead2.jpg';
import TeamLead3 from '../img/teamLead3.jpg';
import TeamLead4 from '../img/teamLead4.jpg';
import TeamLead5 from '../img/teamLead5.jpg';
import TeamLead6 from '../img/teamLead6.jpg';
import TeamLead7 from '../img/teamLead7.jpg';

import '../css/Team.css';

const Team = () => {
	$(document).ready(function () {
		$('.fade-in').each(function (i) {
			var bottom_of_object = $(this).offset().top + $(this).outerHeight();
			var bottom_of_window = $(window).scrollTop() + $(window).height();

			/* If the object is completely visible in the window, fade it it */
			if (bottom_of_window > bottom_of_object) {
				$(this).animate({ opacity: '1' }, 650);
			}
		});
		/* Every time the window is scrolled ... */
		$(window).scroll(function () {
			/* Check the location of each desired element */
			$('.fade-in').each(function (i) {
				var bottom_of_object = $(this).offset().top + $(this).outerHeight() / 3;
				var bottom_of_window = $(window).scrollTop() + $(window).height();

				/* If the object is completely visible in the window, fade it it */
				if (bottom_of_window > bottom_of_object) {
					$(this).animate({ opacity: '1' }, 350);
				}
			});
		});
	});
	return (
		<div className="team">
			<SiteNavbar />
			<Container fluid className="header">
				<Row
					className="justify-content-center align-items-center"
					noGutters="true"
				>
					<h1 className="header1">Meet the Team</h1>
				</Row>
			</Container>
			<Container fluid className="member-container">
				<Row className="justify-content-around member-row">
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead1}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead2}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead3}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
				</Row>

				<Row className="justify-content-around member-row">
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead4}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead5}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead6}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
				</Row>

				<Row className="justify-content-around member-row">
					<Col xs={4} className="text-center">
						<TeamMember
							image={TeamLead7}
							name="testname"
							role="electrical"
							major="eecs"
							bio="hi! im in forumla electric"
						/>
					</Col>
				</Row>
			</Container>
		</div>
	);
};

export default Team;
